import React from "react";

function rbutton() {
	return(
		<>
			<div style={{ float: 'right' }}>
					<button
						type="button"
						className="btn my-2 my-sm-0" 
						data-toggle="modal"
						style={{ background: '#82CAFA', color : 'white' }}
					>
						Register Delivery
					</button>
			</div>
		</>
	)
}
